def getPattern(leng,i,offset=1):
    pattern=[]
    val=0
    for x in base*((leng//4)+1):
        for y in range(i+1):
            if len(pattern)==leng+1: return pattern[offset:]
            pattern.append(x)

def fft(string):
    output=""
    list_=[int(x) for x in string]
    leng=len(list_)
    for i in range(leng):
        pattern = getPattern(leng,i)
        newDigit = sum([x*y for x,y in zip(list_,pattern)])
        output+=str(newDigit)[-1]
    return output

